static String getTimeElapsedSince(long l) {
  l = System.currentTimeMillis() - l;
  return (l / (60000 * 60)) % 60 + ":" + (l / 60000) % 60 + ":" + (l / 1000)
          % 60 + "." + l % 1000;
}

